import React, { useEffect } from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';
import DistrictInfo from './DistrictInfo';
import { proxyUrls } from '../utils/MapConfig';
import Chart from './Chart';
import TabsComp from './TabsComp';
import TabContent from './TabContent';
import { useDispatch, useSelector } from 'react-redux';
import { setDistrict } from '../redux/actions/setDistrictAction';
import { RootState } from '../redux/store/store';

const RowTwo = (props: IRowProps) => {
    const district = useSelector((state: RootState) => state.currentDistrictState.district);
    const dispatch = useDispatch();

    const {
        color,
        height,
        padding
    } = props

     return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <DistrictInfo
                            title='W채hle einen Stadtteil aus.'
                            defaultText='Ausw채hlen...'
                            fetchUrl={proxyUrls[3]}
                        />
                    }
                />
                <Column style={{
                    backgroundColor: color[1],
                    height: height,
                    padding: padding,
                }}
                    content={'Extending Volunteered Geographic Information (VGI) with Geospatial Software as a Service: Participatory Asset Mapping Infrastructures for Urban Health, geoserver credetials, postgres user, Diagramm Legende Karte, selected Features dynamischer,  sql injection, loading while fetching, Tabs diagramm switch gesamt stadtteil'}
                />
                <Column style={{
                    backgroundColor: color[2],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <>
                            <p>Anteil besuchter | unbesuchter Geb채ude (%)</p>
                            <TabsComp>
                                <TabContent label='Gesamtes Stadtgebiet'>
                                    <Chart
                                        id='0'
                                        key='stadtgebiet'
                                        colors={['rgba(179,0,0,0.75)', 'rgba(40,150,0,0.75)']}
                                        hoverColors={['rgba(179,0,0,1)', 'rgba(40,150,0,1)']}
                                        urlToFetch={proxyUrls[5]}
                                    />
                                </TabContent>
                                <TabContent label='Gew채hlter Stadtteil'>
                                    <Chart
                                        id='1'
                                        key='stadtteil'
                                        colors={['rgba(234,160,91,0.75)', 'rgba(91,171,234,0.75)']}
                                        hoverColors={['rgba(234,160,91,1)', 'rgba(91,171,234,1)']}
                                        //@ts-ignore
                                        urlToFetch={`${proxyUrls[8]}${district}`}
                                    />
                                </TabContent>
                            </TabsComp>


                        </>
                    }
                />
            </div>
        </>
    )
}

export default RowTwo;
